--EXCHANGE RATE PROBLEM CHECK','RULE_FCST_0001','1','daily','sql',1000,'','SELECT count(*) FROM(
    SELECT
        RM.REVENUE_AMOUNT,
        (
            CASE WHEN(RLI.REVENUE_TYPE IN(\'SIGNINGS-ACV\' ,\'SAAS-EXT\')) THEN
                CASE WHEN RLI.DURATION > 12 THEN
                    ROUND(( DEC( RLI.REVENUE_AMOUNT ) / CY.CONVERSION_RATE ) / RLI.DURATION * 12 )
                ELSE
                    ROUND( DEC( RLI.REVENUE_AMOUNT ) / CY.CONVERSION_RATE )
                END
            ELSE 
                ROUND( DEC( RLI.REVENUE_AMOUNT ) / CY.CONVERSION_RATE )
            END
        ) AS RM_EXPECTD
    FROM
        IBM_REVENUELINEITEMS RLI INNER JOIN IBM_ROADMAPS RM
            ON RLI.ID = RM.RLI_ID
        AND RM.LIO_OWN = 1
        AND RM.DELETED = 0 INNER JOIN CURRENCIES CY
            ON CY.ID = RLI.CURRENCY_ID
        AND CY.CONVERSION_RATE <> 0
    WHERE
        RLI.REVENUE_AMOUNT > 1
        AND RLI.DELETED = 0
        AND RLI.CURRENCY_ID <> \'-99\'
        AND RM.FORECAST_DATE > \'2017-01-01\'
    )
WHERE
    ABS( REVENUE_AMOUNT - RM_EXPECTD ) > 100
    WITH UR;


